import { Typography } from "@mui/material";
import { IShippingFields } from "../Types/userForm.interface"
import React, { FC } from "react"

const UserItem: FC<IShippingFields> = ({ name, username, phone, email }) => {
    const user = [
        { name, username, phone, email }
    ]
    return (
        <div>
            <div>{name}</div>
            <div>{username}</div>
            <div>{phone}</div>
            <div>{email}</div>
        </div>
    )
}
export default UserItem;
